actionConfiguration.body:
() => {

		if (inputAssignPlanned.isValid == false) {
			return
		}
		var ret = appsmith.store.ASNFormatted
		ret[TableInboundShipments.selectedRowIndex].plannedQuantity = _.toInteger(inputAssignPlanned.text)
		storeValue('ASNFormatted', ret)
		closeModal("modalAssignPlanned")
		return ret
	}

